def getfiles(path):
	for filename in os.listdir(path):
		f = os.path.join(path,filename)
		if os.path.isfile(f):
			if '.dds' in f:
				ddsdict[f] = filename
				ddslist.append(filename)
			elif '.png' in f:
				ddsdict[f] = filename
				ddslist.append(filename)
				pnglist.append(filename)
			elif '.tga' in f:
				ddsdict[f] = filename
				ddslist.append(filename)
				tgalist.append(filename)
		else:
			getfiles(f)


